import PropTypes from 'prop-types'

const tasks = [
    {
        id : 1,
        title : 'Riafy'
    },
    {
        id : 2,
        title : 'Webleks'
    },
    {
        id : 3,
        title : 'Ovalion'
    },
    {
        id : 4,
        title : 'Ewokesoft'
    },
]

const Search = () => {
    return (
        <>
          {
              tasks.map((task) => (
                  <h3>{task.title}</h3>
              ))
          }  
        </>
    )
}

export default Search
